Steedos_data.getFlowSteps = function(flowId){
  return Steedos_data.getFlow(flowId).current.steps;
};

Steedos_data.getStep = function(flowId, stepId){
  
  var steps = Steedos_data.getFlowSteps(flowId);

  var g_step;

  steps.forEach(
    function(step){
      if (step.id == stepId){
        g_step = step;
        return ;
      }
    }
  );

  return g_step;
};

