Steedos_data.getUser = function (userId){

  if (typeof userId != "string"){

    return Steedos_data.getUsers(userId);
  
  }

  var spaceUsers = Steedos_data.getSpaceUsers("") , spaceUser = {};

  spaceUsers.forEach(
    function(user){
        if (user.id == userId){
          spaceUser = user;
          return ;
        }
    }
  );

  return spaceUser;
};

Steedos_data.getUsers = function (userIds){

  var users = new Array();

  if(userIds){
    userIds.forEach(function(userId){
      users.push(Steedos_data.getUser(userId));
    });
  }

  return users;
};

